    data: |
      SELECT col1 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( 45 * - ( col1 ) NOT BETWEEN col2 AND col2 * col1 + - 74 );
  - name: tab2

outputs:
  - name: q3911.out
    data: |
      51
      67
      77
